    SIZE_T  size = sizeof(bloom);
    LARGE_INTEGER sectionSize = {.QuadPart = size};
    HANDLE sectionHandle = NULL;
    PVOID localSectionAddress = NULL;
    PVOID remoteSectionAddress = NULL;
    DWORD PID = 0;
    HMODULE hNTDLL = NULL;
    NTSTATUS ntStatus;
    PLARGE_INTEGER pSectionSize = &sectionSize;
    CLIENT_ID cid = {0};
