    {
        fprintf(stderr, "[!] Error: GetProcAddress(\"RtlCreateUserThread\") failed. Error code: 0x%lx\n", GetLastError());
        FreeLibrary(hNTDLL);
        return EXIT_FAILURE;
    }
    printf("[+] Got the address of RtlCreateUserThread from NTDLL: 0x%p\n", thRtlCreateUserThread);

